import React from 'react';
import "./portfolio.scss";
import educationService from '../services/educationService';


class  Portfolio extends React.Component {

      constructor(props){
        super(props)
        this.state = {
          educations:[]
        }
      }
      componentDidMount(){
        educationService.getEducations().then((response) => {
          this.setState({ educations: response.data
          })
        });
      }
render (){
  return <div className='Portfolio' id="portfolio">
    <div className="left">

      <h2>Education</h2>

       <table className='=table table-striped'>
         <thead>
           <tr>
                     <td> education id</td>
                     <td> eduaction name</td>
                     <td>education periode</td>
                     <td>specialité</td>
                   

           </tr>
         </thead>

         <tbody>
           {
              this.state.educations.map(
                education =>
                <tr Key = { education.id}>
                  <td>{ education.id}</td>
                  <td>{education.nom_etablissement}</td>
                  <td>{education.periode}</td>
                  <td>{education.specialité}</td>
                </tr>
              )
           }
           </tbody>
       </table>




    </div>
    <div className="right">Experience</div>
  </div>;
}
}
